import React, { Component } from 'react'

export default class Navbar extends Component {
    handleFormSubmit = (event) => {
        event.preventDefault()
    }
    render() {

        return (
            <nav class="navbar navbar-expand-lg bg-dark fixed-top">
                <div class="container-fluid">
                    <a class="navbar-brand text-white" href="/">Ä°ngilizce Kelimeler</a>


                    <form class="d-flex" role="search" onSubmit={handleFormSubmit}>
                        <input class="form-control me-2" type="search" placeholder="Kelime Ara"
                            aria-label="Search" onChange={this.props.searchWordProp} />
                    </form>
                </div>
            </nav>
        );
    }
}
